local vehicleVariations = {}
local blacklistedVehicles = {
    [562] = true
}

function registerVehicleData(model, difficulty, color, pictureName, maskName, partNames, imagePartNames)
    if blacklistedVehicles[model] then
        return
    end
    vehicleVariations[model] = vehicleVariations[model] or {}
    vehicleVariations[model][difficulty] = vehicleVariations[model][difficulty] or {}
    vehicleVariations[model][difficulty][color:gsub("#", "")] = {
        pictureName = pictureName,
        maskName = maskName,
        partNames = partNames,
        imagePartNames = imagePartNames,
        color = color
    }
end

