-- Kasztni és Karosszéria nem lehet egy autón, ha mégis van akkor túl lesz árazva (Karosszéria tudtommal ki lett törölve amúgy is mindenhonnan)
-- Lehető legkevesebb amit adhat = 25.000*0,7=17.500 
-- Lehet legtöbb amit adhat = 495.000*1,2=594.000
local partPrices = {
    ["Karosszéria"]      = 150000, -- 150k
    ["Hátsó lökhárító"]  = 45000,  -- 45k
    ["Első lökhárító"]   = 55000,  -- 55k
    ["Motorháztető"]     = 85000,  -- 85k
    ["Csomagtartó"]      = 65000,  -- 65k
    ["Bal első ajtó"]    = 25000,  -- 25k
    ["Jobb első ajtó"]   = 25000,  -- 25k
    ["Bal hátsó ajtó"]   = 25000,  -- 25k
    ["Jobb hátsó ajtó"]  = 25000,  -- 25k
    ["Jobb oldali ajtó"] = 25000,  -- 25k
    ["Bal oldali ajtó"]  = 25000,  -- 25k
    ["Kasztni"]          = 150000, -- 150k
}

function calculateVehiclePrice(parts)
    local total = 0
    for _, name in ipairs(parts) do
        local price = partPrices[name]
        if price then
            total = total + price * math.random(0.7, 1.2)
        end
    end
    return math.floor(total)
end

function selectRandomVehicle(difficultyLevel)
    local candidates = {}
    for model, byLevel in pairs(vehicleVariations) do
        if byLevel[difficultyLevel] then
            table.insert(candidates, model)
        end
    end
    if #candidates == 0 then return nil end

    local selModel = candidates[math.random(#candidates)]
    local colors    = {}
    for c in pairs(vehicleVariations[selModel][difficultyLevel]) do
        table.insert(colors, c)
    end
    if #colors == 0 then return nil end

    local selColor = colors[math.random(#colors)]
    local data     = vehicleVariations[selModel][difficultyLevel][selColor]

    return {
        vehicleID      = selModel,
        difficulty     = difficultyLevel,
        color          = data.color,
        pictureName    = data.pictureName,
        maskName       = data.maskName,
        partNames      = data.partNames,
        imagePartNames = data.imagePartNames
    }
end